function doorOpen(x, y, z, enable) {
    var open = Level.getData(x, y, z);

    if (enable = 1) {
        if (open < 4 && open != 8) {
            open = open + 4;
            Level.playSound(x, y, z, "random.door_open", 1);
        }
    } else {
        if (open >= 4 && open != 8) {
            open = open - 4;
            Level.playSound(x, y, z, "random.door_close", 1);
        }
    }

    setTile(x, y, z, getTile(x, y, z), open);
}

