var fileName = "herobrine"

function saveFile(filename) {

    directory = android.os.Environment.getExternalStorageDirectory()
        .getPath() + "/games/com.mojang/minecraftworlds/" + Level.getWorldName() + "/";
    var newFile = new java.io.File(directory, "" + fileName + ".dat");
    var directory = new java.io.File(directory);

    var success = directory.mkdirs();
    if (!success) {
        throw new java.io.IOException("Directory " + directory + "cannot be created");
    }
    newFile.delete();
    newFile.createNewFile();
    var outWrite = new java.io.OutputStreamWriter(new java.io.FileOutputStream(newFile));
    outWrite.append("{" + structureName + "," + version + "}," + "{" + this.alesa + "}");
    outWrite.close();
    return false;
}

